import Data.List

--Passes two arguments to solve the partition problem
partitionSolver :: [Int] -> [Int]
partitionSolver [] = []
partitionSolver xs = partitionSolver' (target xs) (reverse(sort xs))

--Solves partition problem if head is greater than half of sum
partitionSolver' :: Int -> [Int] -> [Int]
partitionSolver' 0 xs 	      = []
partitionSolver' a [] 	      = []
partitionSolver' a xs
	| a == (head xs) = [head xs]
	| otherwise 	 = partitionSolver'' a xs

--Returns one side of the partition
partitionSolver'' a xs  = 	if (head xs < a)
                                then head xs : partitionSolver' (a - head xs) (tail xs)	
                                else partitionSolver' a (tail xs)

--Calculates the target sum of the first partition
target :: [Int] -> Int         
target []   = 0
target xs   = if (sum xs `mod` 2 == 0)
                    then (sum xs) `div` 2
                    else ((sum xs) `div` 2) + 1

--Returns the two partitions    
printPartition :: [Int] -> ([Int],[Int])
printPartition []    = ([],[])
printPartition a = (partitionSolver  a, (a \\ partitionSolver  a))

--Returns the difference between partitions
difference :: [Int] -> Int 
difference [] = 0
difference a = abs (sum (fst (printPartition a)) - sum(snd (printPartition a)))

